83491.png" style="width:140px;height:175px" alt="" /></a></div>    </div>         <div class="body" >tet</div></div><br/><div class="post reply" id="reply_286"><p class="intro"><input type="checkbox" class="delete" name="delete_286" id="delete_286" /><label for="delete_286"><span class="name">Anonymous</span> <time datetime="2019-09-26T16:00:55Z">09/26/19 (Thu) 16:00:55</time></label>&nbsp;<a class="post_no" id="post_no_286" onclick="return highlightReply(286, event)" href="/test/res/284#286">No.</a><a class="post_no" onclick="return citeReply(286)" href="/test/res/284#q286">286</a></p>        <div class="files">    </div>         <div class="body" >ta</div></div><br/><div class="post reply" id="reply_287"><p class="intro"><input type="checkbox" class="delete" name="delete_287" id="delete_287" /><label for="delete_287"><span class="name">Anonymous</span> <time datetime="2019-09-26T16:01:00Z">09/26/19 (Thu) 16:01:00</time></label>&nbsp;<a class="post_no" id="post_no_287" onclick="return highlightReply(287, event)" href="/test/res/284#287">No.</a><a class="post_no" onclick="return citeReply(287)" href="/test/res/284#q287">287</a></p>        <div class="files">    </div>         <div class="body" ><a onclick="return highlightReply('286', event);" href="/test/res/284#286">&gt;&gt;286</a></div></div><br/><br class="clear"/><hr/></div><h2><a href="/qa">/qa/</a></h2><div class="thread" id="thread_10535" data-board="qa">    <div class="files">            <div class="file"><p class="fileinfo">File: <a href="/qa/src/1569430857898.jpg">1569430857898.jpg</a> <span class="unimportant">(65.61 KB, 750x606, <span class="postfilename" title="[yurucamp][group][artist- nikoo]b86518a0fa8fee407ce1b57c40144485.jpg">[yurucamp][group][artist- ….jpg</span>)</span></p><a href="/qa/src/1569430857898.jpg" target="_blank"><img class="post-image" src="/qa/thumb/1569430857898.png" style="width:255px;height:206px" alt="" /></a></div>    </div>    <div class="post op" id="op_10535" ><p class="intro"><input type="checkbox" class="delete" name="delete_10535" id="delete_10535" /><label for="delete_10535"><span class="name">Anonymous</span> <time datetime="2019-09-25T17:00:57Z">09/25/19 (Wed) 17:00:57</time></label>&nbsp;<a class="post_no" id="post_no_10535" onclick="return highlightReply(10535, event)" href="/qa/res/10535#10535">No.</a><a class="post_no" onclick="return citeReply(10535)" href="/qa/res/10535#q10535">10535</a><a href="/qa/res/10535">[Reply]</a></p><div class="body">I knew that most of us already knew that tanasin's "complete history of 4chan" has been really awful the past few years, but the /qa/ part of it for the past month is truly atrocious.<br/><a href="http://tanasinn.info/wiki/Complete_History_of_4chan#2019" rel="nofollow" target="_blank">http://tanasinn.info/wiki/Complete_History_of_4chan#2019</a><br/>Should we update it to reflect the mass rangebans and other staff chicanery, or just leave it to rot?</div><span class="omitted">10 posts omitted. Click reply to view.</span></div><div class="post reply" id="reply_10546"><p class="intro"><input type="checkbox" class="delete" name="delete_10546" id="delete_10546" /><label for="delete_10546"><span class="name">Anonymous</span> <time datetime="2019-09-25T17:40:31Z">09/25/19 (Wed) 17:40:31</time></label>&nbsp;<a class="post_no" id="post_no_10546" onclick="return highlightReply(10546, event)" href="/qa/res/10535#10546">No.</a><a class="post_no" onclick="return citeReply(10546)" href="/qa/res/10535#q10546">10546</a></p>        <div class="files">    </div>         <div class="body" ><a onclick="return highlightReply('10544', event);" href="/qa/res/10535#10544">&gt;&gt;10544</a><br/>for agruements sake, if the "frog-anime war" is worth mentioning when it's mostly one guy shitting up a board, this site is worth mentioning<br/>also weirdly enough /qa/ has a lot entries on that list (54)./tv/ has 37, /s4s/ has 17, /jp/ has 9, /bant/ has 23, /g/ has 40, /trash/ has 10,  /a/ has 81, /v/ has 111, /pol/ has 140, /b/ has 403</div></div><br/><div class="post reply" id="reply_10550"><p class="intro"><input type="checkbox" class="delete" name="delete_10550" id="delete_10550" /><label for="delete_10550"><a class="sage" href="javascript:void(0); %20noko%20sage"><span class="name">Anonymous</span></a> <time datetime="2019-09-25T18:49:38Z">09/25/19 (Wed) 18:49:38</time></label>&nbsp;<a class="post_no" id="post_no_10550" onclick="return highlightReply(10550, event)" href="/qa/res/10535#10550">No.</a><a class="post_no" onclick="return citeReply(10550)" href="/qa/res/10535#q10550">10550</a></p>        <div class="files">    </div>         <div class="body" >I'd rather not. It's not like the article gives in-depth explanations of each board, it's more of an event tally.<br/><a onclick="return highlightReply('10546', event);" href="/qa/res/10535#10546">&gt;&gt;10546</a><br/>There's a lot of points that comment "there was discussion in /qa/" or "[group] went to /qa/". That'd explain the amount of mentions.</div></div><br/><div class="post reply" id="reply_10635"><p class="intro"><input type="checkbox" class="delete" name="delete_10635" id="delete_10635" /><label for="delete_10635"><span class="name">Anonymous</span> <time datetime="2019-09-26T15:33:35Z">09/26/19 (Thu) 15:33:35</time></label>&nbsp;<a class="post_no" id="post_no_10635" onclick="return highlightReply(10635, event)" href="/qa/res/10535#10635">No.</a><a class="post_no" onclick="return citeReply(10635)" href="/qa/res/10535#q10635">10635</a></p>        <div class="files">    </div>         <div class="body" ><a onclick="return highlightReply('10550', event);" href="/qa/res/10535#10550">&gt;&gt;10550</a><br/>Even for historical accuracy? I mean, I understand that the list is incorrect on so many things (and is pretty much just /v/ and /pol/ now) , but to see it brushed under the carpet rubs me the wrong way.</div></div><br/><div class="post reply" id="reply_10642"><p class="intro"><input type="checkbox" class="delete" name="delete_10642" id="delete_10642" /><label for="delete_10642"><span class="name">Anonymous</span> <time datetime="2019-09-26T15:53:04Z">09/26/19 (Thu) 15:53:04</time></label>&nbsp;<a class="post_no" id="post_no_10642" onclick="return highlightReply(10642, event)" href="/qa/res/10535#10642">No.</a><a class="post_no" onclick="return citeReply(10642)" href="/qa/res/10535#q10642">10642</a></p>        <div class="files">    </div>         <div class="body" ><span class="quote">&gt;Complete_History_of_4chan#2019</span><br/>more like complete history of fail LMAO</div></div><br/><div class="post reply" id="reply_10643"><p class="intro"><input type="checkbox" class="delete" name="delete_10643" id="delete_10643" /><label for="delete_10643"><span class="name">Anonymous</span> <time datetime="2019-09-26T15:59:59Z">09/26/19 (Thu) 15:59:59</time></label>&nbsp;<a class="post_no" id="post_no_10643" onclick="return highlightReply(10643, event)" href="/qa/res/10535#10643">No.</a><a class="post_no" onclick="return citeReply(10643)" href="/qa/res/10535#q10643">10643</a></p>        <div class="files">    </div>         <div class="body" ><a onclick="return highlightReply('10635', event);" href="/qa/res/10535#10635">&gt;&gt;10635</a><br/>I don't think you should really go in-depth and show bias like he said since it doesn't really fit in with the more just listing of events. That doesn't mean you can't explain the situation a bit using bullet points alone. The mods made enough sweeping changes to how the board works that you can somewhat paint a picture of what happened without resorting to just saying what specifically happened to the community.</div></div><br/><br class="clear"/><hr/></div><h2><a href="/qa">/qa/</a></h2><div class="thread" id="thread_9599" data-board="qa">    <div class="files">            <div class="file"><p class="fileinfo">File: <a href="/qa/src/1568923381297.png">1568923381297.png</a> <span class="unimportant">(3.65 MB, 2279x1412, <span class="postfilename">1374