="files">    </div>         <div class="body" >Oh, that's simple enough</div></div><br/><div class="post reply" id="reply_10626"><p class="intro"><input type="checkbox" class="delete" name="delete_10626" id="delete_10626" /><label for="delete_10626"><span class="name">Anonymous</span> <time datetime="2019-09-26T11:26:50Z">09/26/19 (Thu) 11:26:50</time></label>&nbsp;<a class="post_no" id="post_no_10626" onclick="return highlightReply(10626, event)" href="/qa/res/5007#10626">No.</a><a class="post_no" onclick="return citeReply(10626)" href="/qa/res/5007#q10626">10626</a></p>        <div class="files">    </div>         <div class="body" >y'know what<br/>im gonna start over from scratch<br/>gonna relearn japanese (even though i never learned it in the first place!)</div></div><br/><div class="post reply" id="reply_10630"><p class="intro"><input type="checkbox" class="delete" name="delete_10630" id="delete_10630" /><label for="delete_10630"><span class="name">Anonymous</span> <time datetime="2019-09-26T14:22:42Z">09/26/19 (Thu) 14:22:42</time></label>&nbsp;<a class="post_no" id="post_no_10630" onclick="return highlightReply(10630, event)" href="/qa/res/5007#10630">No.</a><a class="post_no" onclick="return citeReply(10630)" href="/qa/res/5007#q10630">10630</a></p>        <div class="files">    </div>         <div class="body" >Remember: you cannot fail as long as you don't give up. 前進あるのみ</div></div><br/><br class="clear"/><hr/></div><h2><a href="/agg">/agg/</a></h2><div class="thread" id="thread_2175" data-board="agg"><div class="video-container" data-video="3gpagwpr_TA"><a href="https://youtu.be/3gpagwpr_TA" target="_blank" class="file"><img style="width:360px;height:270px;" src="//img.youtube.com/vi/3gpagwpr_TA/0.jpg" class="post-image"/></a></div>    <div class="post op" id="op_2175" ><p class="intro"><input type="checkbox" class="delete" name="delete_2175" id="delete_2175" /><label for="delete_2175"><span class="name">Diarrhea Dan</span> <time datetime="2019-09-26T13:50:03Z">09/26/19 (Thu) 13:50:03</time></label>&nbsp;<a class="post_no" id="post_no_2175" onclick="return highlightReply(2175, event)" href="/agg/res/2175#2175">No.</a><a class="post_no" onclick="return citeReply(2175)" href="/agg/res/2175#q2175">2175</a><i class="fa fa-lock" title="Locked"></i><a href="/agg/res/2175">[Reply]</a></p><div class="body"><span class="quote">&gt;gn</span><br/><a href=https://gnfos.com/jp/res/369677.html>https://gnfos.com/jp/res/369677.html</a></div></div><br class="clear"/><hr/></div><h2><a href="/qa">/qa/</a></h2><div class="thread" id="thread_10533" data-board="qa">    <div class="files">            <div class="file"><p class="fileinfo">File: <a href="/qa/src/1569429915108.jpg">1569429915108.jpg</a> <span class="unimportant">(431.93 KB, 1280x1024, <span class="postfilename" title="__artemis_and_hazuki_tsukuyomi_moonphase_drawn_by_aizawa_masahiro__c315f15a06db742af46b391eb6fbb4c3.jpg">__artemis_and_hazuki_tsuku….jpg</span>)</span></p><a href="/qa/src/1569429915108.jpg" target="_blank"><img class="post-image" src="/qa/thumb/1569429915108.png" style="width:255px;height:204px" alt="" /></a></div>    </div>    <div class="post op" id="op_10533" ><p class="intro"><input type="checkbox" class="delete" name="delete_10533" id="delete_10533" /><label for="delete_10533"><span class="name">Anonymous</span> <time datetime="2019-09-25T16:45:15Z">09/25/19 (Wed) 16:45:15</time></label>&nbsp;<a class="post_no" id="post_no_10533" onclick="return highlightReply(10533, event)" href="/qa/res/10533#10533">No.</a><a class="post_no" onclick="return citeReply(10533)" href="/qa/res/10533#q10533">10533</a><a href="/qa/res/10533">[Reply]</a></p><div class="body">Have you ever been mesmerized by an anime's soundtrack? To the point you think you may have missed some crucial plot points, or that you remember the ost more than the events?</div><span class="omitted">3 posts omitted. Click reply to view.</span></div><div class="post reply" id="reply_10602"><p class="intro"><input type="checkbox" class="delete" name="delete_10602" id="delete_10602" /><label for="delete_10602"><a class="sage" href="javascript:void(0); sage"><span class="name">Anonymous</span></a> <time datetime="2019-09-26T02:10:19Z">09/26/19 (Thu) 02:10:19</time></label>&nbsp;<a class="post_no" id="post_no_10602" onclick="return highlightReply(10602, event)" href="/qa/res/10533#10602">No.</a><a class="post_no" onclick="return citeReply(10602)" href="/qa/res/10533#q10602">10602</a></p>        <div class="files">            <div class="file"><p class="fileinfo">File: <a href="/qa/src/1569463819038.jpg">1569463819038.jpg</a> <span class="unimportant">(151.34 KB, 1025x904, <span class="postfilename">1166016383053.jpg</span>)</span></p><a href="/qa/src/1569463819038.jpg" target="_blank"><img class="post-image" src="/qa/thumb/1569463819038.png" style="width:175px;height:154px" alt="" /></a></div>    </div>         <div class="body" >The Rozen Maiden OST is amazing. I still listen to it frequently. Reminds me of better times and just makes me feel good in general.</div></div><br/><div class="post reply" id="reply_10606"><p class="intro"><input type="checkbox" class="delete" name="delete_10606" id="delete_10606" /><label for="delete_10606"><a class="sage" href="javascript:void(0); sage"><span class="name">Anonymous</span></a> <time datetime="2019-09-26T02:38:06Z">09/26/19 (Thu) 02:38:06</time></label>&nbsp;<a class="post_no" id="post_no_10606" onclick="return highlightReply(10606, event)" href="/qa/res/10533#10606">No.</a><a class="post_no" onclick="return citeReply(10606)" href="/qa/res/10533#q10606">10606</a></p>        <div class="files">    </div>         <div class="body" ><a onclick="return highlightReply('10602', event);" href="/qa/res/10533#10602">&gt;&gt;10602</a><br/>I wonder if it's just due to how long ago I watched it, but I'd completely forgotten how great the OST was. Thanks for reminding me, Anonymous.</div></div><br/><div class="post reply" id="reply_10607"><p class="intro"><input type="checkbox" class="delete" name="delete_10607" id="delete_10607" /><label for="delete_10607"><a class="noko" href="javascript:void(0); noko"><span class="name">Anonymous</span></a> <time datetime="2019-09-26T03:40:00Z">09/26/19 (Thu) 03:40:00</time></label>&nbsp;<a class="post_no" id="post_no_10607" onclick="return highlightReply(10607, event)" href="/qa/res/10533#10607">No.</a><a class="post_no" onclick="return citeReply(10607)" href="/qa/res/10533#q10607">10607</a></p>    <iframe style="float: left;margin: 10px 20px;" width="300" height="246" frameborder="0" id="ytplayer" src="https://www.youtube.com/embed/aS-3Qnzray4" allowfullscreen></iframe>         <div class="body" >The Noein OST is criminally underrated.</div></div><br/><div class="post reply" id="reply_10610"><p class="intro"><input type="checkbox" class="delete" name="delete_10610" id="delete_10610" /><label for="delete_10610"><a class="email" href="mailto:%20"><span class="name">Anonymous</span></a> <time datetime="2019-09-26T04:34:42Z">09/26/19 (Thu) 04:34:42</time></label>&nbsp;<a class="post_no" id="post_no_10610" onclick="return highlightReply(10610, event)" href="/qa/res/10533#10610">No.</a><a class="post_no" onclick="return citeReply(10610)" href="/qa/res/10533#q10610">10610</a></p>        <div class="files">    </div>         <div class="body" >Escaflowne and Trinity Seven. Then there's also the soundtrack of Ping Pong which is so great I didn't even bother with watching the anime.</div></div><br/><div class="post reply" id="reply_10625"><p class="intro"><input type="checkbox" class="delete" name="delete_10625" id="delete_10625" /><label for="delete_10625"><span class="name">Anonymous</span> <time datetime="2019-09-26T11:15:09Z">09/26/19 (Thu) 11:15:09</time></label>&nbsp;<a class="post_no" id="post_no_10625" onclick="return highlightReply(10625, event)" href="/qa/res/10533#10625">No.</a><a class="post_no" onclick="return citeReply(10625)" href="/qa/res/10533#q10625">